s.x:
var $bm_rt;
var txt, txt_w, txt_h, comp_w, comp_h, N_w, N_h, max_w, x, x, max_h, y, y;
txt = thisComp.layer(index);
txt_w = txt.sourceRectAtTime(time, false).width;
txt_h = txt.sourceRectAtTime(time, false).height;
comp_w = thisComp.width;
comp_h = thisComp.height;
N_w = div(thisComp.layer(index).effect('Width Limit')('Slider').value, 100);
N_h = div(thisComp.layer(index).effect('Height Limit')('Slider').value, 100);
max_w = mul(comp_w, N_w);
if (txt_w > max_w) {
    x = div(mul(max_w, 100), txt_w);
} else {
    x = 100;
}
max_h = mul(comp_h, N_h);
if (txt_h > max_h) {
    y = div(mul(max_h, 100), txt_h);
} else {
    y = 100;
}
$bm_rt = [
    x,
    y
];
